import React from 'react';

class Login extends React.Component {
    handleChange = (e) => {
        e.preventDefault();
        let {name, value} = e.target;
        this.setState({
            [name]: value.toLowerCase()
        },
        console.log(name, value));
    };

    onSubmit = (e) => {
        e.preventDefault();
    };
    render() {
        return (
            <div>
                <form id={"filter-gallery"} className={"row align-items-center"} onSubmit={onSubmit}>
                    <input className={"d-none d-md-inline"} placeholder={"email"} onChange={(e) => handleChange(e)} name={"emailLogin"}
                           id="address"/>
                    <input className={"d-none d-md-inline"} onChange={(e) => handleChange(e)} name={"city"}>

                    </input>
                </form>
            </div>
        )
    }
}

export default Login;
